causeDescription.value:
Документи, що підтверджують наявність умов застосування переговорної процедури закупівлі:
– Закон України «Про природні монополії»;
– Зведений перелік суб’єктів природних монополій, оприлюднений на офіційному веб-порталі Антимонопольного комітету України (www.amc.gov.ua);
– Реєстр суб’єктів природних монополій в сфері енергетики, розміщений на офіційному сайті Національної комісії, що здійснює державне регулювання у сфері енергетики (www.nеrc.gov.ua)

